import "./BoxRHS.css";
import Login from "./Login_Reg/Login";
import Pic from "./LoginImg/Login.jpg"

const BoxRHS = () => {
    return(
        <div className="BoxRHSBody">
            <div>
                <img src={Pic} alt="LoginImage" width="300px" height="300px" id="Login"/>
            </div>
            <div className="LoginDiv">
                <Login/>
            </div>            
        </div>
    );
}

export default BoxRHS;


